import React from 'react';
import s from './Navbar.module.css';
import { NavLink } from 'react-router-dom'

const Navbar = () => {
    return <nav className={s.nav}>
        {<div className={`${s.item}, ${s.active}`}> <NavLink to='/Profile' activeClassNa>Profile</NavLink></div> }
        <div className={s.item}><NavLink to="/News">News</NavLink></div>
        <div className={s.item}><NavLink to="/Friends">Friends</NavLink></div>
        <div className={s.item}><NavLink to="/Photo">Photo</NavLink></div>
        <div className={s.item}><NavLink to="/Dialogs">Message</NavLink></div>
        <div className={s.item}><NavLink to="/Settings">Settings</NavLink></div>
    </nav> 
}

export default Navbar;
